"    <li class=\"plainItem\">",
"     <a class=\"outlineLink\" href=\"#H1568141\">",
"      Are there other kinds of treatments that can help with pain?",
"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"outlineLink\" href=\"#H1568148\">",
"      More on this topic",
"     </a>",
"    </li>",
"   </ul>",
